Most tests in rust-analyzer start with a snippet of Rust code. These snippets should be minimal -- if you copy-paste a snippet of real code into the tests, make sure to remove everything which could be removed. It also makes sense to format snippets more compactly (for example, by placing enum definitions like enum E { Foo, Bar } on a single line), as long as they are still readable. When using multiline fixtures, use unindented raw string literals: #[test] fn inline_field_shorthand() { check_assist( inline_local_variable, r#"
struct S { foo: i32}
fn main() { let $0foo = 92; S { foo }
}
"#, r#"
struct S { foo: i32}
fn main() { S { foo: 92 }
}
"#, ); } Rationale: There are many benefits to this: less to read or to scroll past easier to understand what exactly is tested less stuff printed during printf-debugging less time to run test Formatting ensures that you can use your editor's "number of selected characters" feature to correlate offsets with test's source code.

