Express function preconditions in types and force the caller to provide them (rather than checking in callee): // GOOD
fn frobnicate(walrus: Walrus) { ...
} // BAD
fn frobnicate(walrus: Option<Walrus>) { let walrus = match walrus { Some(it) => it, None => return, }; ...
} Rationale: this makes control flow explicit at the call site. Call-site has more context, it often happens that the precondition falls out naturally or can be bubbled up higher in the stack. Avoid splitting precondition check and precondition use across functions: // GOOD
fn main() { let s: &str = ...; if let Some(contents) = string_literal_contents(s) { }
} fn string_literal_contents(s: &str) -> Option<&str> { if s.starts_with('"') && s.ends_with('"') { Some(&s[1..s.len() - 1]) } else { None }
} // BAD
fn main() { let s: &str = ...; if is_string_literal(s) { let contents = &s[1..s.len() - 1]; }
} fn is_string_literal(s: &str) -> bool { s.starts_with('"') && s.ends_with('"')
} In the "Not as good" version, the precondition that 1 is a valid char boundary is checked in is_string_literal and used in foo. In the "Good" version, the precondition check and usage are checked in the same block, and then encoded in the types. Rationale: non-local code properties degrade under change. When checking a boolean precondition, prefer if !invariant to if negated_invariant: // GOOD
if !(idx < len) { return None;
} // BAD
if idx >= len { return None;
} Rationale: it's useful to see the invariant relied upon by the rest of the function clearly spelled out.

