As a special case of the previous rule, do not hide control flow inside functions, push it to the caller: // GOOD
if cond { f()
} // BAD
fn f() { if !cond { return; } ...
}

129.body:
If a field can have any value without breaking invariants, make the field public. Conversely, if there is an invariant, document it, enforce it in the "constructor" function, make the field private, and provide a getter. Never provide setters. Getters should return borrowed data: struct Person { // Invariant: never empty first_name: String, middle_name: Option<String>
} // GOOD
impl Person { fn first_name(&self) -> &str { self.first_name.as_str() } fn middle_name(&self) -> Option<&str> { self.middle_name.as_ref() }
} // BAD
impl Person { fn first_name(&self) -> String { self.first_name.clone() } fn middle_name(&self) -> &Option<String> { &self.middle_name }
} Rationale: we don't provide public API, it's cheaper to refactor than to pay getters rent. Non-local code properties degrade under change, privacy makes invariant local. Borrowed owned types (&String) disclose irrelevant details about internal representation. Irrelevant (neither right nor wrong) things obscure correctness.

131.body:
Prefer Default to zero-argument new function. // GOOD
#[derive(Default)]
struct Foo { bar: Option<Bar>
} // BAD
struct Foo { bar: Option<Bar>
} impl Foo { fn new() -> Foo { Foo { bar: None } }
} Prefer Default even if it has to be implemented manually. Rationale: less typing in the common case, uniformity. Use Vec::new rather than vec![]. Rationale: uniformity, strength reduction. Avoid using "dummy" states to implement a Default. If a type doesn't have a sensible default, empty value, don't hide it. Let the caller explicitly decide what the right initial state is.

