Avoid creating "doer" objects. That is, objects which are created only to execute a single action. // GOOD
do_thing(arg1, arg2); // BAD
ThingDoer::new(arg1, arg2).do(); Note that this concerns only outward API. When implementing do_thing, it might be very useful to create a context object. pub fn do_thing(arg1: Arg1, arg2: Arg2) -> Res { let mut ctx = Ctx { arg1, arg2 }; ctx.run()
} struct Ctx { arg1: Arg1, arg2: Arg2
} impl Ctx { fn run(self) -> Res { ... }
} The difference is that Ctx is an impl detail here. Sometimes a middle ground is acceptable if this can save some busywork: ThingDoer::do(arg1, arg2); pub struct ThingDoer { arg1: Arg1, arg2: Arg2,
} impl ThingDoer { pub fn do(arg1: Arg1, arg2: Arg2) -> Res { ThingDoer { arg1, arg2 }.run() } fn run(self) -> Res { ... }
} Rationale: not bothering the caller with irrelevant details, not mixing user API with implementor API.

133.body:
Avoid creating functions with many optional or boolean parameters. Introduce a Config struct instead. // GOOD
pub struct AnnotationConfig { pub binary_target: bool, pub annotate_runnables: bool, pub annotate_impls: bool,
} pub fn annotations( db: &RootDatabase, file_id: FileId, config: AnnotationConfig
) -> Vec<Annotation> { ...
} // BAD
pub fn annotations( db: &RootDatabase, file_id: FileId, binary_target: bool, annotate_runnables: bool, annotate_impls: bool,
) -> Vec<Annotation> { ...
} Rationale: reducing churn. If the function has many parameters, they most likely change frequently. By packing them into a struct we protect all intermediary functions from changes. Do not implement Default for the Config struct, the caller has more context to determine better defaults. Do not store Config as a part of the state, pass it explicitly. This gives more flexibility for the caller. If there is variation not only in the input parameters, but in the return type as well, consider introducing a Command type. // MAYBE GOOD
pub struct Query { pub name: String, pub case_sensitive: bool,
} impl Query { pub fn all(self) -> Vec<Item> { ... } pub fn first(self) -> Option<Item> { ... }
} // MAYBE BAD
fn query_all(name: String, case_sensitive: bool) -> Vec<Item> { ... }
fn query_first(name: String, case_sensitive: bool) -> Option<Item> { ... }

134.body:
If a function has a bool or an Option parameter, and it is always called with true, false, Some and None literals, split the function in two. // GOOD
fn caller_a() { foo()
} fn caller_b() { foo_with_bar(Bar::new())
} fn foo() { ... }
fn foo_with_bar(bar: Bar) { ... } // BAD
fn caller_a() { foo(None)
} fn caller_b() { foo(Some(Bar::new()))
} fn foo(bar: Option<Bar>) { ... } Rationale: more often than not, such functions display "false sharing" -- they have additional if branching inside for two different cases. Splitting the two different control flows into two functions simplifies each path, and remove cross-dependencies between the two paths. If there's common code between foo and foo_with_bar, extract that into a common helper.

