Separate import groups with blank lines. Use one use per crate. Module declarations come before the imports. Order them in "suggested reading order" for a person new to the code base. mod x;
mod y; // First std.
use std::{ ... } // Second, external crates (both crates.io crates and other rust-analyzer crates).
use crate_foo::{ ... }
use crate_bar::{ ... } // Then current crate.
use crate::{} // Finally, parent and child modules, but prefer `use crate::`.
use super::{} // Re-exports are treated as item definitions rather than imports, so they go
// after imports and modules. Use them sparingly.
pub use crate::x::Z; Rationale: consistency. Reading order is important for new contributors. Grouping by crate allows spotting unwanted dependencies easier.

