} Rationale: overall, less typing. Makes it clear that a trait is implemented, rather than used. Avoid local use MyEnum::* imports. Rationale: consistency. Prefer use crate::foo::bar to use super::bar or use self::bar::baz. Rationale: consistency, this is the style which works in all cases. By default, avoid re-exports. Rationale: for non-library code, re-exports introduce two ways to use something and allow for inconsistency.

