Optimize for the reader who sees the file for the first time, and wants to get a general idea about what's going on. People read things from top to bottom, so place most important things first. Specifically, if all items except one are private, always put the non-private item on top. // GOOD
pub(crate) fn frobnicate() { Helper::act()
} #[derive(Default)]
struct Helper { stuff: i32 } impl Helper { fn act(&self) { }
} // BAD
#[derive(Default)]
struct Helper { stuff: i32 } pub(crate) fn frobnicate() { Helper::act()
} impl Helper { fn act(&self) { }
} If there's a mixture of private and public items, put public items first. Put structs and enums first, functions and impls last. Order type declarations in top-down manner. // GOOD
struct Parent { children: Vec<Child>
} struct Child; impl Parent {
} impl Child {
} // BAD
struct Child; impl Child {
} struct Parent { children: Vec<Child>
} impl Parent {
} Rationale: easier to get the sense of the API by visually scanning the file. If function bodies are folded in the editor, the source code should read as documentation for the public API.

