Some parameters are threaded unchanged through many function calls. They determine the "context" of the operation. Pass such parameters first, not last. If there are several context parameters, consider packing them into a struct Ctx and passing it as &self. // GOOD
fn dfs(graph: &Graph, v: Vertex) -> usize { let mut visited = FxHashSet::default(); return go(graph, &mut visited, v); fn go(graph: &Graph, visited: &mut FxHashSet<Vertex>, v: usize) -> usize { ... }
} // BAD
fn dfs(v: Vertex, graph: &Graph) -> usize { fn go(v: usize, graph: &Graph, visited: &mut FxHashSet<Vertex>) -> usize { ... } let mut visited = FxHashSet::default(); go(v, graph, &mut visited)
} Rationale: consistency. Context-first works better when non-context parameter is a lambda.

149.body:
Do use early returns // GOOD
fn foo() -> Option<Bar> { if !condition() { return None; } Some(...)
} // BAD
fn foo() -> Option<Bar> { if condition() { Some(...) } else { None }
} Rationale: reduce cognitive stack usage. Use return Err(err) to throw an error: // GOOD
