The (green) tree is constructed by a DFS "traversal" of the desired tree structure: pub struct GreenNodeBuilder { ... } impl GreenNodeBuilder { pub fn new() -> GreenNodeBuilder { ... } pub fn token(&mut self, kind: SyntaxKind, text: &str) { ... } pub fn start_node(&mut self, kind: SyntaxKind) { ... } pub fn finish_node(&mut self) { ... } pub fn finish(self) -> GreenNode { ... }
} The parser, ultimately, needs to invoke the GreenNodeBuilder. There are two principal sources of inputs for the parser: source text, which contains trivia tokens (whitespace and comments) token trees from macros, which lack trivia Additionally, input tokens do not correspond 1-to-1 with output tokens. For example, two consecutive > tokens might be glued, by the parser, into a single >>. For these reasons, the parser crate defines a callback interfaces for both input tokens and output trees. The explicit glue layer then bridges various gaps. The parser interface looks like this: pub struct Token { pub kind: SyntaxKind, pub is_joined_to_next: bool,
} pub trait TokenSource { fn current(&self) -> Token; fn lookahead_nth(&self, n: usize) -> Token; fn is_keyword(&self, kw: &str) -> bool; fn bump(&mut self);
} pub trait TreeSink { fn token(&mut self, kind: SyntaxKind, n_tokens: u8); fn start_node(&mut self, kind: SyntaxKind); fn finish_node(&mut self); fn error(&mut self, error: ParseError);
} pub fn parse( token_source: &mut dyn TokenSource, tree_sink: &mut dyn TreeSink,
) { ... } Points of note: The parser and the syntax tree are independent, they live in different crates neither of which depends on the other. The parser doesn't know anything about textual contents of the tokens, with an isolated hack for checking contextual keywords. For gluing tokens, the TreeSink::token might advance further than one atomic token ahead. Reporting Syntax Errors Syntax errors are not stored directly in the tree. The primary motivation for this is that syntax tree is not necessary produced by the parser, it may also be assembled manually from pieces (which happens all the time in refactorings). Instead, parser reports errors to an error sink, which stores them in a Vec. If possible, errors are not reported during parsing and are postponed for a separate validation step. For example, parser accepts visibility modifiers on trait methods, but then a separate tree traversal flags all such visibilities as erroneous. Macros The primary difficulty with macros is that individual tokens have identities, which need to be preserved in the syntax tree for hygiene purposes. This is handled by the TreeSink layer. Specifically, TreeSink constructs the tree in lockstep with draining the original token stream. In the process, it records which tokens of the tree correspond to which tokens of the input, by using text ranges to identify syntax tokens. The end result is that parsing an expanded code yields a syntax tree and a mapping of text-ranges of the tree to original tokens. To deal with precedence in cases like $expr * 1, we use special invisible parenthesis, which are explicitly handled by the parser. Whitespace & Comments Parser does not see whitespace nodes. Instead, they are attached to the tree in the TreeSink layer. For example, in // non doc comment
fn foo() {} the comment will be (heuristically) made a child of function node. Incremental Reparse Green trees are cheap to modify, so incremental reparse works by patching a previous tree, without maintaining any additional state. The reparse is based on heuristic: we try to contain a change to a single {} block, and reparse only this block. To do this, we maintain the invariant that, even for invalid code, curly braces are always paired correctly. In practice, incremental reparsing doesn't actually matter much for IDE use-cases, parsing from scratch seems to be fast enough. Parsing Algorithm We use a boring hand-crafted recursive descent + pratt combination, with a special effort of continuing the parsing if an error is detected. Parser Recap Parser itself defines traits for token sequence input and syntax tree output. It doesn't care about where the tokens come from, and how the resulting syntax tree looks like.

