Source: config.rs The Installation section contains details on configuration for some of the editors. In general rust-analyzer is configured via LSP messages, which means that it’s up to the editor to decide on the exact format and location of configuration files. Some clients, such as VS Code or COC plugin in Vim provide rust-analyzer specific configuration UIs. Others may require you to know a bit more about the interaction with rust-analyzer. For the later category, it might help to know that the initial configuration is specified as a value of the initializationOptions field of the InitializeParams message, in the LSP protocol . The spec says that the field type is any?, but rust-analyzer is looking for a JSON object that is constructed using settings from the list below. Name of the setting, ignoring the rust-analyzer. prefix, is used as a path, and value of the setting becomes the JSON property value. For example, a very common configuration is to enable proc-macro support, can be achieved by sending this JSON: { "cargo": { "buildScripts": { "enable": true, }, }, "procMacro": { "enable": true, }
} Please consult your editor’s documentation to learn more about how to configure LSP servers . To verify which configuration is actually used by rust-analyzer, set RA_LOG environment variable to rust_analyzer=info and look for config-related messages. Logs should show both the JSON that rust-analyzer sees as well as the updated config. This is the list of config options rust-analyzer supports: rust-analyzer.assist.emitMustUse (default: false) Whether to insert #[must_use] when generating as_ methods for enum variants. rust-analyzer.assist.expressionFillDefault (default: "todo") Placeholder expression to use for missing expressions in assists. rust-analyzer.assist.termSearch.borrowcheck (default: true) Enable borrow checking for term search code assists. If set to false, also there will be more suggestions, but some of them may not borrow-check. rust-analyzer.assist.termSearch.fuel (default: 1800) Term search fuel in "units of work" for assists (Defaults to 1800). rust-analyzer.cachePriming.enable (default: true) Warm up caches on project load. rust-analyzer.cachePriming.numThreads (default: "physical") How many worker threads to handle priming caches. The default 0 means to pick automatically. rust-analyzer.cargo.allTargets (default: true) Pass --all-targets to cargo invocation. rust-analyzer.cargo.autoreload (default: true) Automatically refresh project info via cargo metadata on Cargo.toml or .cargo/config.toml changes. rust-analyzer.cargo.buildScripts.enable (default: true) Run build scripts (build.rs) for more precise code analysis. rust-analyzer.cargo.buildScripts.invocationStrategy (default: "per_workspace") Specifies the invocation strategy to use when running the build scripts command. If per_workspace is set, the command will be executed for each Rust workspace with the workspace as the working directory. If once is set, the command will be executed once with the opened project as the working directory. This config only has an effect when #rust-analyzer.cargo.buildScripts.overrideCommand# is set. rust-analyzer.cargo.buildScripts.overrideCommand (default: null) Override the command rust-analyzer uses to run build scripts and build procedural macros. The command is required to output json and should therefore include --message-format=json or a similar option. If there are multiple linked projects/workspaces, this command is invoked for each of them, with the working directory being the workspace root (i.e., the folder containing the Cargo.toml). This can be overwritten by changing #rust-analyzer.cargo.buildScripts.invocationStrategy#. By default, a cargo invocation will be constructed for the configured targets and features, with the following base command line: cargo check --quiet --workspace --message-format=json --all-targets --keep-going . rust-analyzer.cargo.buildScripts.rebuildOnSave (default: true) Rerun proc-macros building/build-scripts running when proc-macro or build-script sources change and are saved. rust-analyzer.cargo.buildScripts.useRustcWrapper (default: true) Use RUSTC_WRAPPER=rust-analyzer when running build scripts to avoid checking unnecessary things. rust-analyzer.cargo.cfgs Default: "debug_assertions", "miri"
] List of cfg options to enable with the given values. To enable a name without a value, use "key". To enable a name with a value, use "key=value". To disable, prefix the entry with a !. rust-analyzer.cargo.extraArgs (default: []) Extra arguments that are passed to every cargo invocation. rust-analyzer.cargo.extraEnv (default: {}) Extra environment variables that will be set when running cargo, rustc or other commands within the workspace. Useful for setting RUSTFLAGS. rust-analyzer.cargo.features (default: []) List of features to activate. Set this to "all" to pass --all-features to cargo. rust-analyzer.cargo.noDefaultFeatures (default: false) Whether to pass --no-default-features to cargo. rust-analyzer.cargo.sysroot (default: "discover") Relative path to the sysroot, or "discover" to try to automatically find it via "rustc --print sysroot". Unsetting this disables sysroot loading. This option does not take effect until rust-analyzer is restarted. rust-analyzer.cargo.sysrootSrc (default: null) Relative path to the sysroot library sources. If left unset, this will default to {cargo.sysroot}/lib/rustlib/src/rust/library. This option does not take effect until rust-analyzer is restarted. rust-analyzer.cargo.target (default: null) Compilation target override (target tuple). rust-analyzer.cargo.targetDir (default: null) Optional path to a rust-analyzer specific target directory. This prevents rust-analyzer's cargo check and initial build-script and proc-macro building from locking the Cargo.lock at the expense of duplicating build artifacts. Set to true to use a subdirectory of the existing target directory or set to a path relative to the workspace to use that path. rust-analyzer.cfg.setTest (default: true) Set cfg(test) for local crates. Defaults to true. rust-analyzer.checkOnSave (default: true) Run the check command for diagnostics on save. rust-analyzer.check.allTargets (default: null) Check all targets and tests (--all-targets). Defaults to #rust-analyzer.cargo.allTargets#. rust-analyzer.check.command (default: "check") Cargo command to use for cargo check. rust-analyzer.check.extraArgs (default: []) Extra arguments for cargo check. rust-analyzer.check.extraEnv (default: {}) Extra environment variables that will be set when running cargo check. Extends #rust-analyzer.cargo.extraEnv#. rust-analyzer.check.features (default: null) List of features to activate. Defaults to #rust-analyzer.cargo.features#. Set to "all" to pass --all-features to Cargo. rust-analyzer.check.ignore (default: []) List of cargo check (or other command specified in check.command) diagnostics to ignore. For example for cargo check: dead_code, unused_imports, unused_variables,... rust-analyzer.check.invocationStrategy (default: "per_workspace") Specifies the invocation strategy to use when running the check command. If per_workspace is set, the command will be executed for each workspace. If once is set, the command will be executed once. This config only has an effect when #rust-analyzer.check.overrideCommand# is set. rust-analyzer.check.noDefaultFeatures (default: null) Whether to pass --no-default-features to Cargo. Defaults to #rust-analyzer.cargo.noDefaultFeatures#. rust-analyzer.check.overrideCommand (default: null) Override the command rust-analyzer uses instead of cargo check for diagnostics on save. The command is required to output json and should therefore include --message-format=json or a similar option (if your client supports the colorDiagnosticOutput experimental capability, you can use --message-format=json-diagnostic-rendered-ansi). If you're changing this because you're using some tool wrapping Cargo, you might also want to change #rust-analyzer.cargo.buildScripts.overrideCommand#. If there are multiple linked projects/workspaces, this command is invoked for each of them, with the working directory being the workspace root (i.e., the folder containing the Cargo.toml). This can be overwritten by changing #rust-analyzer.check.invocationStrategy#. If $saved_file is part of the command, rust-analyzer will pass the absolute path of the saved file to the provided command. This is intended to be used with non-Cargo build systems. Note that $saved_file is experimental and may be removed in the future. An example command would be: cargo check --workspace --message-format=json --all-targets . rust-analyzer.check.targets (default: null) Check for specific targets. Defaults to #rust-analyzer.cargo.target# if empty. Can be a single target, e.g. "x86_64-unknown-linux-gnu" or a list of targets, e.g. ["aarch64-apple-darwin", "x86_64-apple-darwin"]. Aliased as "checkOnSave.targets". rust-analyzer.check.workspace (default: true) Whether --workspace should be passed to cargo check. If false, -p <package> will be passed instead if applicable. In case it is not, no check will be performed. rust-analyzer.completion.addSemicolonToUnit (default: true) Whether to automatically add a semicolon when completing unit-returning functions. In match arms it completes a comma instead. rust-analyzer.completion.autoAwait.enable (default: true) Toggles the additional completions that automatically show method calls and field accesses with await prefixed to them when completing on a future. rust-analyzer.completion.autoIter.enable (default: true) Toggles the additional completions that automatically show method calls with iter() or into_iter() prefixed to them when completing on a type that has them. rust-analyzer.completion.autoimport.enable (default: true) Toggles the additional completions that automatically add imports when completed. Note that your client must specify the additionalTextEdits LSP client capability to truly have this feature enabled. rust-analyzer.completion.autoimport.exclude Default: { "path": "core::borrow::Borrow", "type": "methods" }, { "path": "core::borrow::BorrowMut", "type": "methods" }
] A list of full paths to items to exclude from auto-importing completions. Traits in this list won't have their methods suggested in completions unless the trait is in scope. You can either specify a string path which defaults to type "always" or use the more verbose form { "path": "path::to::item", type: "always" }. For traits the type "methods" can be used to only exclude the methods but not the trait itself. This setting also inherits #rust-analyzer.completion.excludeTraits#. rust-analyzer.completion.autoself.enable (default: true) Toggles the additional completions that automatically show method calls and field accesses with self prefixed to them when inside a method. rust-analyzer.completion.callable.snippets (default: "fill_arguments") Whether to add parenthesis and argument snippets when completing function. rust-analyzer.completion.excludeTraits (default: []) A list of full paths to traits whose methods to exclude from completion. Methods from these traits won't be completed, even if the trait is in scope. However, they will still be suggested on expressions whose type is dyn Trait, impl Trait or T where T: Trait. Note that the trait themselves can still be completed. rust-analyzer.completion.fullFunctionSignatures.enable (default: false) Whether to show full function/method signatures in completion docs. rust-analyzer.completion.hideDeprecated (default: false) Whether to omit deprecated items from autocompletion. By default they are marked as deprecated but not hidden. rust-analyzer.completion.limit (default: null) Maximum number of completions to return. If None, the limit is infinite. rust-analyzer.completion.postfix.enable (default: true) Whether to show postfix snippets like dbg, if, not, etc. rust-analyzer.completion.privateEditable.enable (default: false) Enables completions of private items and fields that are defined in the current workspace even if they are not visible at the current position. rust-analyzer.completion.snippets.custom Default: "Ok": { "postfix": "ok", "body": "Ok(${receiver})", "description": "Wrap the expression in a `Result::Ok`", "scope": "expr" }, "Box::pin": { "postfix": "pinbox", "body": "Box::pin(${receiver})", "requires": "std::boxed::Box", "description": "Put the expression into a pinned `Box`", "scope": "expr" }, "Arc::new": { "postfix": "arc", "body": "Arc::new(${receiver})", "requires": "std::sync::Arc", "description": "Put the expression into an `Arc`", "scope": "expr" }, "Some": { "postfix": "some", "body": "Some(${receiver})", "description": "Wrap the expression in an `Option::Some`", "scope": "expr" }, "Err": { "postfix": "err", "body": "Err(${receiver})", "description": "Wrap the expression in a `Result::Err`", "scope": "expr" }, "Rc::new": { "postfix": "rc", "body": "Rc::new(${receiver})", "requires": "std::rc::Rc", "description": "Put the expression into an `Rc`", "scope": "expr" }
} Custom completion snippets. rust-analyzer.completion.termSearch.enable (default: false) Whether to enable term search based snippets like Some(foo.bar().baz()). rust-analyzer.completion.termSearch.fuel (default: 1000) Term search fuel in "units of work" for autocompletion (Defaults to 1000). rust-analyzer.diagnostics.disabled (default: []) List of rust-analyzer diagnostics to disable. rust-analyzer.diagnostics.enable (default: true) Whether to show native rust-analyzer diagnostics. rust-analyzer.diagnostics.experimental.enable (default: false) Whether to show experimental rust-analyzer diagnostics that might have more false positives than usual. rust-analyzer.diagnostics.remapPrefix (default: {}) Map of prefixes to be substituted when parsing diagnostic file paths. This should be the reverse mapping of what is passed to rustc as --remap-path-prefix. rust-analyzer.diagnostics.styleLints.enable (default: false) Whether to run additional style lints. rust-analyzer.diagnostics.warningsAsHint (default: []) List of warnings that should be displayed with hint severity. The warnings will be indicated by faded text or three dots in code and will not show up in the Problems Panel. rust-analyzer.diagnostics.warningsAsInfo (default: []) List of warnings that should be displayed with info severity. The warnings will be indicated by a blue squiggly underline in code and a blue icon in the Problems Panel. rust-analyzer.files.exclude (default: []) These paths (file/directories) will be ignored by rust-analyzer. They are relative to the workspace root, and globs are not supported. You may also need to add the folders to Code's files.watcherExclude. rust-analyzer.files.watcher (default: "client") Controls file watching implementation. rust-analyzer.highlightRelated.breakPoints.enable (default: true) Enables highlighting of related references while the cursor is on break, loop, while, or for keywords. rust-analyzer.highlightRelated.closureCaptures.enable (default: true) Enables high