yzer.inlayHints.typeHints.hideClosureInitialization (default: false) Whether to hide inlay type hints for let statements that initialize to a closure. Only applies to closures with blocks, same as #rust-analyzer.inlayHints.closureReturnTypeHints.enable#. rust-analyzer.inlayHints.typeHints.hideClosureParameter (default: false) Whether to hide inlay parameter type hints for closures. rust-analyzer.inlayHints.typeHints.hideNamedConstructor (default: false) Whether to hide inlay type hints for constructors. rust-analyzer.interpret.tests (default: false) Enables the experimental support for interpreting tests. rust-analyzer.joinLines.joinAssignments (default: true) Join lines merges consecutive declaration and initialization of an assignment. rust-analyzer.joinLines.joinElseIf (default: true) Join lines inserts else between consecutive ifs. rust-analyzer.joinLines.removeTrailingComma (default: true) Join lines removes trailing commas. rust-analyzer.joinLines.unwrapTrivialBlock (default: true) Join lines unwraps trivial blocks. rust-analyzer.lens.debug.enable (default: true) Whether to show Debug lens. Only applies when #rust-analyzer.lens.enable# is set. rust-analyzer.lens.enable (default: true) Whether to show CodeLens in Rust files. rust-analyzer.lens.implementations.enable (default: true) Whether to show Implementations lens. Only applies when #rust-analyzer.lens.enable# is set. rust-analyzer.lens.location (default: "above_name") Where to render annotations. rust-analyzer.lens.references.adt.enable (default: false) Whether to show References lens for Struct, Enum, and Union. Only applies when #rust-analyzer.lens.enable# is set. rust-analyzer.lens.references.enumVariant.enable (default: false) Whether to show References lens for Enum Variants. Only applies when #rust-analyzer.lens.enable# is set. rust-analyzer.lens.references.method.enable (default: false) Whether to show Method References lens. Only applies when #rust-analyzer.lens.enable# is set. rust-analyzer.lens.r