ed semantic tokens for operators. When enabled, rust-analyzer will emit special token types for operator tokens instead of the generic operator token type. rust-analyzer.semanticHighlighting.punctuation.enable (default: false) Use semantic tokens for punctuation. When disabled, rust-analyzer will emit semantic tokens only for punctuation tokens when they are tagged with modifiers or have a special role. rust-analyzer.semanticHighlighting.punctuation.separate.macro.bang (default: false) When enabled, rust-analyzer will emit a punctuation semantic token for the ! of macro calls. rust-analyzer.semanticHighlighting.punctuation.specialization.enable (default: false) Use specialized semantic tokens for punctuation. When enabled, rust-analyzer will emit special token types for punctuation tokens instead of the generic punctuation token type. rust-analyzer.semanticHighlighting.strings.enable (default: true) Use semantic tokens for strings. In some editors (e.g. vscode) semantic tokens override other highlighting grammars. By disabling semantic tokens for strings, other grammars can be used to highlight their contents. rust-analyzer.signatureInfo.detail (default: "full") Show full signature of the callable. Only shows parameters if disabled. rust-analyzer.signatureInfo.documentation.enable (default: true) Show documentation. rust-analyzer.typing.triggerChars (default: "=.") Specify the characters allowed to invoke special on typing triggers. typing = after let tries to smartly add ; if = is followed by an existing expression typing = between two expressions adds ; when in statement position typing = to turn an assignment into an equality comparison removes ; when in expression position typing . in a chain method call auto-indents typing { or ( in front of an expression inserts a closing } or ) after the expression typing { in a use item adds a closing } in the right place typing > to complete a return type -> will insert a whitespace after it typing < in a path or type posit