Warning : This format is provisional and subject to change. [DiscoverWorkspaceConfig::command] must return a JSON object corresponding to DiscoverProjectData::Finished: #[derive(Debug, Clone, Deserialize, Serialize)]
#[serde(tag = "kind")]
#[serde(rename_all = "snake_case")]
enum DiscoverProjectData { Finished { buildfile: Utf8PathBuf, project: ProjectJsonData }, Error { error: String, source: Option<String> }, Progress { message: String },
} As JSON, DiscoverProjectData::Finished is: { // the internally-tagged representation of the enum. "kind": "finished", // the file used by a non-Cargo build system to define // a package or target. "buildfile": "rust-analyzer/BUILD", // the contents of a rust-project.json, elided for brevity "project": { "sysroot": "foo", "crates": [] }
} It is encouraged, but not required, to use the other variants on DiscoverProjectData to provide a more polished end-user experience. DiscoverWorkspaceConfig::command may optionally include an {arg}, which will be substituted with the JSON-serialized form of the following enum: #[derive(PartialEq, Clone, Debug, Serialize)]
#[serde(rename_all = "camelCase")]
pub enum DiscoverArgument { Path(AbsPathBuf), Buildfile(AbsPathBuf),
} The JSON representation of DiscoverArgument::Path is: { "path": "src/main.rs"
} Similarly, the JSON representation of DiscoverArgument::Buildfile is: { "buildfile": "BUILD"
} DiscoverArgument::Path is used to find and generate a rust-project.json, and therefore, a workspace, whereas DiscoverArgument::buildfile is used to to update an existing workspace. As a reference for implementors, buck2's rust-project will likely be useful: https://github.com/facebook/buck2/tree/main/integrations/rust-project. rust-analyzer.workspace.symbol.search.kind (default: "only_types") Workspace symbol search kind. rust-analyzer.workspace.symbol.search.limit (default: 128) Limits the number of items returned from a workspace symbol search (Defaults to 128). Some clients like vs-code issue new searches on result filtering and don't require all results to be returned in the initial search. Other clients requires all results upfront and might require a higher limit. rust-analyzer.workspace.symbol.search.scope (default: "workspace") Workspace symbol search scope.

