Assists, or code actions, are small local refactorings, available in a particular context. They are usually triggered by a shortcut or by clicking a light bulb icon in the editor. Cursor position or selection is signified by ┃ character. add_braces Source: add_braces.rs Adds braces to lambda and match arm expressions. Before fn foo(n: i32) -> i32 { match n { 1 =>┃ n + 1, _ => 0 }
} After fn foo(n: i32) -> i32 { match n { 1 => { n + 1 }, _ => 0 }
} add_explicit_enum_discriminant Source: add_explicit_enum_discriminant.rs Adds explicit discriminant to all enum variants. Before enum TheEnum┃ { Foo, Bar, Baz = 42, Quux,
} After enum TheEnum { Foo = 0, Bar = 1, Baz = 42, Quux = 43,
} add_explicit_type Source: add_explicit_type.rs Specify type for a let binding. Before fn main() { let x┃ = 92;
} After fn main() { let x: i32 = 92;
} add_hash Source: raw_string.rs Adds a hash to a raw string literal. Before fn main() { r#"Hello,┃ World!"#;
} After fn main() { r##"Hello, World!"##;
} add_impl_default_members Source: add_missing_impl_members.rs Adds scaffold for overriding default impl members. Before trait Trait { type X; fn foo(&self); fn bar(&self) {}
} impl Trait for () { type X = (); fn foo(&self) {}┃
} After trait Trait { type X; fn foo(&self); fn bar(&self) {}
} impl Trait for () { type X = (); fn foo(&self) {} ┃fn bar(&self) {}
} add_impl_missing_members Source: add_missing_impl_members.rs Adds scaffold for required impl members. Before trait Trait<T> { type X; fn foo(&self) -> T; fn bar(&self) {}
} impl Trait<u32> for () {┃ } After trait Trait<T> { type X; fn foo(&self) -> T; fn bar(&self) {}
} impl Trait<u32> for () { ┃type X; fn foo(&self) -> u32 { todo!() }
} add_label_to_loop Source: add_label_to_loop.rs Adds a label to a loop. Before fn main() { loop┃ { break; continue; }
} After fn main() { 'l: loop { break 'l; continue 'l; }
} add_lifetime_to_type Source: add_lifetime_to_type.rs Adds a new lifetime to a struct, enum or union. Before struct Point { x: &┃u32, y: u32,
} After struct Point<'a> { x: &'a u32, y: u32,
} add_missing_match_arms Source: add_missing_match_arms.rs Adds missing clauses to a match expression. Before enum Action { Move { distance: u32 }, Stop } fn handle(action: Action) { match action { ┃ }
} After enum Action { Move { distance: u32 }, Stop } fn handle(action: Action) { match action { Action::Move { distance } => ${1:todo!()}, Action::Stop => ${2:todo!()},┃ }
} add_return_type Source: add_return_type.rs Adds the return type to a function or closure inferred from its tail expression if it doesn't have a return type specified. This assists is useable in a functions or closures tail expression or return type position. Before fn foo() { 4┃2i32 } After fn foo() -> i32 { 42i32 } add_turbo_fish Source: add_turbo_fish.rs Adds ::<_> to a call of a generic method or function. Before fn make<T>() -> T { todo!() }
fn main() { let x = make┃();
} After fn make<T>() -> T { todo!() }
fn main() { let x = make::<${0:_}>();
} apply_demorgan Source: apply_demorgan.rs Apply De Morgan's law . This transforms expressions of the form !l || !r into !(l && r). This also works with &&. This assist can only be applied with the cursor on either || or &&. Before fn main() { if x != 4 ||┃ y < 3.14 {}
} After fn main() { if !(x == 4 && y >= 3.14) {}
} apply_demorgan_iterator Source: apply_demorgan.rs Apply De Morgan's law to Iterator::all and Iterator::any. This transforms expressions of the form !iter.any(|x| predicate(x)) into iter.all(|x| !predicate(x)) and vice versa. This also works the other way for Iterator::all into Iterator::any. Before fn main() { let arr = [1, 2, 3]; if !arr.into_iter().┃any(|num| num == 4) { println!("foo"); }
} After fn main() { let arr = [1, 2, 3]; if arr.into_iter().all(|num| num != 4) { println!("foo"); }
} auto_import Source: auto_import.rs If the name is unresolved, provides all possible imports for it. Before fn main() { let map = HashMap┃::new();
} After use std::collections::HashMap; fn main() { let map = HashMap::new();
} bind_unused_param Source: bind_unused_param.rs Binds unused function parameter to an underscore. Before fn some_function(x: i32┃) {} After fn some_function(x: i32) { let _ = x;
} change_visibility Source: change_visibility.rs Adds or changes existing visibility specifier. Before ┃fn frobnicate() {} After pub(crate) fn frobnicate() {} comment_to_doc Source: convert_comment_from_or_to_doc.rs Converts comments to documentation. Before // Wow what ┃a nice module
// I sure hope this shows up when I hover over it After //! Wow what a nice module
//! I sure hope this shows up when I hover over it convert_bool_then_to_if Source: convert_bool_then.rs Converts a bool::then method call to an equivalent if expression. Before fn main() { (0 == 0).then┃(|| val)
} After fn main() { if 0 == 0 { Some(val) } else { None }
} convert_bool_to_enum Source: convert_bool_to_enum.rs This converts boolean local variables, fields, constants, and statics into a new enum with two variants Bool::True and Bool::False, as well as replacing all assignments with the variants and replacing all usages with == Bool::True or == Bool::False. Before fn main() { let ┃bool = true; if bool { println!("foo"); }
} After #[derive(PartialEq, Eq)]
enum Bool { True, False } fn main() { let bool = Bool::True; if bool == Bool::True { println!("foo"); }
} convert_closure_to_fn Source: convert_closure_to_fn.rs This converts a closure to a freestanding function, changing all captures to parameters. Before fn main() { let mut s = String::new(); let closure = |┃a| s.push_str(a); closure("abc");
} After fn main() { let mut s = String::new(); fn closure(a: &str, s: &mut String) { s.push_str(a) } closure("abc", &mut s);
} convert_for_loop_to_while_let Source: convert_for_to_while_let.rs Converts a for loop into a while let on the Iterator. Before fn main() { let x = vec![1, 2, 3]; for┃ v in x { let y = v * 2; };
} After fn main() { let x = vec![1, 2, 3]; let mut tmp = x.into_iter(); while let Some(v) = tmp.next() { let y = v * 2; };
} convert_for_loop_with_for_each Source: convert_iter_for_each_to_for.rs Converts a for loop into a for_each loop on the Iterator. Before fn main() { let x = vec![1, 2, 3]; for┃ v in x { let y = v * 2; }
} After fn main() { let x = vec![1, 2, 3]; x.into_iter().for_each(|v| { let y = v * 2; });
} convert_from_to_tryfrom Source: convert_from_to_tryfrom.rs Converts a From impl to a TryFrom impl, wrapping returns in Ok. Before impl ┃From<usize> for Thing { fn from(val: usize) -> Self { Thing { b: val.to_string(), a: val } }
} After impl TryFrom<usize> for Thing { type Error = ${0:()}; fn try_from(val: usize) -> Result<Self, Self::Error> { Ok(Thing { b: val.to_string(), a: val }) }
