} Invoking code action at this position will yield two code actions for importing Entry from either collections::HashMap or collection::BTreeMap, grouped under a single "import" group. Unresolved Questions Is a fixed two-level structure enough? Should we devise a general way to encode custom interaction protocols for GUI refactorings?

