} Response: Runnable[] interface Runnable { label: string; /// If this Runnable is associated with a specific function/module, etc., the location of this item location?: LocationLink; /// Running things is necessary technology specific, `kind` needs to be advertised via server capabilities, // the type of `args` is specific to `kind`. The actual running is handled by the client. kind: string; args: any;
} rust-analyzer supports two kinds of runnables, "cargo" and "shell". The args for "cargo" look like this: { /** * Environment variables to set before running the command. */ environment?: Record<string, string>; /** * The working directory to run the command in. */ cwd: string; /** * The workspace root directory of the cargo project. */ workspaceRoot?: string; /** * The cargo command to run. */ cargoArgs: string[]; /** * Arguments to pass to the executable, these will be passed to the command after a `--` argument. */ executableArgs: string[]; /** * Command to execute instead of `cargo`. */ overrideCargo?: string;
} The args for "shell" look like this: { /** * Environment variables to set before running the command. */ environment?: Record<string, string>; /** * The working directory to run the command in. */ cwd: string; kind: string; program: string; args: string[];
}

