There are several LSP client implementations for Vim or Neovim: coc-rust-analyzer Install coc.nvim by following the instructions at coc.nvim (Node.js required) Run :CocInstall coc-rust-analyzer to install coc-rust-analyzer , this extension implements most of the features supported in the VSCode extension: automatically install and upgrade stable/nightly releases same configurations as VSCode extension, rust-analyzer.server.path, rust-analyzer.cargo.features etc. same commands too, rust-analyzer.analyzerStatus, rust-analyzer.ssr etc. inlay hints for variables and method chaining, Neovim Only Note: coc-rust-analyzer is capable of installing or updating the rust-analyzer binary on its own. Note: for code actions, use coc-codeaction-cursor and coc-codeaction-selected; coc-codeaction and coc-codeaction-line are unlikely to be useful. LanguageClient-neovim Install LanguageClient-neovim by following the instructions here The GitHub project wiki has extra tips on configuration Configure by adding this to your Vim/Neovim config file (replacing the existing Rust-specific line if it exists): let g:LanguageClient_serverCommands = {
\ 'rust': ['rust-analyzer'],
\ } YouCompleteMe Install YouCompleteMe by following the instructions here . rust-analyzer is the default in ycm, it should work out of the box. ALE To use the LSP server in ale : let g:ale_linters = {'rust': ['analyzer']} nvim-lsp Neovim 0.5 has built-in language server support. For a quick start configuration of rust-analyzer, use neovim/nvim-lspconfig . Once neovim/nvim-lspconfig is installed, use lua require'lspconfig'.rust_analyzer.setup({}) in your init.vim. You can also pass LSP settings to the server: lua << EOF
local lspconfig = require'lspconfig' local on_attach = function(client) require'completion'.on_attach(client)
end lspconfig.rust_analyzer.setup({ on_attach = on_attach, settings = { ["rust-analyzer"] = { imports = { granularity = { group = "module", }, prefix = "self", }, cargo = { buildScripts = { enable = true, }, }, procMacro = { enable = true }, } }
})
EOF If you're running Neovim 0.10 or later, you can enable inlay hints via on_attach: lspconfig.rust_analyzer.setup({ on_attach = function(client, bufnr) vim.lsp.inlay_hint.enable(true, { bufnr = bufnr }) end
}) Note that the hints are only visible after rust-analyzer has finished loading and you have to edit the file to trigger a re-render. See https://sharksforarms.dev/posts/neovim-rust/ for more tips on getting started. Check out https://github.com/mrcjkb/rustaceanvim for a batteries included rust-analyzer setup for Neovim. vim-lsp vim-lsp is installed by following the plugin instructions . It can be as simple as adding this line to your .vimrc: Plug 'prabirshrestha/vim-lsp' Next you need to register the rust-analyzer binary. If it is avim.lspvailable in $PATH, you may want to add this to your .vimrc: if executable('rust-analyzer') au User lsp_setup call lsp#register_server({ \ 'name': 'Rust Language Server', \ 'cmd': {server_info->['rust-analyzer']}, \ 'whitelist': ['rust'], \ })
endif There is no dedicated UI for the server configuration, so you would need to send any options as a value of the initialization_options field, as described in the Configuration section. Here is an example of how to enable the proc-macro support: if executable('rust-analyzer') au User lsp_setup call lsp#register_server({ \ 'name': 'Rust Language Server', \ 'cmd': {server_info->['rust-analyzer']}, \ 'whitelist': ['rust'], \ 'initialization_options': { \ 'cargo': { \ 'buildScripts': { \ 'enable': v:true, \ }, \ }, \ 'procMacro': { \ 'enable': v:true, \ }, \ }, \ })
endif

